26/sept./24 9:15 AM;604626e7d7f56e007181df2a;Bonjour,

Merci pour les détails fournis. L'erreur “Unable to start ORCHESTRATE job: PAT_PMwaitForPlayersToStart failed...” semble indiquer un problème de configuration des nœuds pour l'exécution parallèle.

Pour avancer, voici les étapes à suivre sous Windows Server 2022 pour activer des logs détaillés et vérifier la configuration :

# *Activer les logs* : Ajoutez les variables d’environnement suivantes via *Paramètres système avancés > Variables d’environnement* ou dans les paramètres du job via Datastage Director :
#* {{APT_DUMP_SCORE=True}}
#* {{APT_PM_PLAYER_TIMING=True}}
#* {{APT_PM_SHOW_PIDS=True}}
#* {{APT_ORCH_TRACE_OPTIONS=-all}}
# *Vérifier le fichier Config.apt* : Le fichier *Config.apt* se trouve généralement dans le répertoire suivant :
{{C:\IBM\InformationServer\Server\Configurations\Config.apt}}
Assurez-vous que la configuration des nœuds est correcte et que les chemins d’accès sont bien définis.
# *Collecte des logs* : Après modification, relancez le job et collectez les logs depuis Datastage Director et le répertoire temporaire (généralement {{&PH&}}).

Transmettez-nous ces fichiers pour analyse, nous pourrions ainsi les transmettre à IBM si besoin. 

Nous restons à votre disposition.

Cordialement,
Issam

