column307:
28/août/23 11:03 AM;5ffda6f244065f013fedb413;Bonjour,

Je suis surpris de voir plusieurs lignes concernant le serveur FRSELWPAPPCOG20 dans le fichier diag.json : 


{code:java}
"com.ibm.bi.flipper.core.GroupMember@4e4cd227 host: FRSELWPAPPCOG20 port: 5701",

"com.ibm.bi.flipper.core.GroupMember@1b9249ce host: FRSELWPAPPCOG20.atlas.hermes port: 5701",
{code}


La première des 2 lignes ci-dessus ne devrait pas apparaître.

Avez-vous plusieurs installations de Cognos sur ce serveur FRSELWPAPPCOG20 ?



Est-ce que le serveur FRSELWPAPPCOG19.atlas.hermes correspond bien au Content Manager principal ?

Je ne comprends pas pourquoi le serveur japonais apparaît en 


{code:java}
"com.ibm.bi.flipper.core.GroupMember@a7ab44e5 host: 10.148.3.75 port: 5701",

{code}

alors qu’il devrait apparaître en : 


{code:java}
"com.ibm.bi.flipper.core.GroupMember@a7ab44e5 host: jphjpwpappcog11 port: 5701",
{code}




Pouvez-vous vérifier pourquoi la configuration de jphjpwpappcog11 ne semble pas cohérente avec les autres serveurs basés en France ?

Cordialement,

Patrick Neveu

