column297:
09/nov./22 11:55 AM;qm:0d856b9c-898c-4295-9061-d3410070d001:9b6d49bd-8986-4b09-85e2-aae3a250b257;{color:#1F497D}Bonjour, oui nous essayons de valider une migration de version de notre environnement Cognos.{color} 

{color:#1F497D}Nous avons donc importé les datas d’une version 11.0 vers 11.2.3…et pour le moment le seul souci que nous rencontrons est ce choix systématique d’une connexion au lancement d’un rapport.{color} 

